import React from "react";
import "../../assets";
import { Link } from "react-router-dom";
import { compose } from "redux";

const GenModelsHello = (props) => {
  console.log(props.gen_models.models);
  return (
    <>
      <div className="gen-models-filter__wrap">
        <h2>Quick Filter</h2>
      </div>


      <div className="gen-models__wrap">
        <h2>Generator Types</h2>
      <div className="gen-models"></div>
      <div className="gen-model">
      <div className="gen-model__title"><h4>XBO37/8</h4></div>
      <div className="gen-model__package">Steel case 20x20x12.6 mm</div>
      <div className="gen-model__picture"><img className="gen-model__picture--decor" src={require("../../assets/img/type4_200px.png")} alt="xtal XBO37/8" /></div> 

      <div className="gen-model__btn">Specification</div>
      </div>

      </div>

      <div>
        <pre>{JSON.stringify(props, null, 2)}</pre>
      </div>

    </>
  );
};

export default GenModelsHello;
